export default function Item({seller, setSelectedItems, sellerTitle, images, itemTitle, itemDesc, price}){

    function getImages(){
        if(images != null){
        return images.map((image) =>{
            return <img src={image} alt="img"/>
        })
    }
    }

    return (
    <>
    <div className='itemBorder'onClick={setSelectedItems((prev=>{
        return prev[seller]
    }))}>
        <div className="sellerTitle">{sellerTitle}</div>
        <div className="itemImages">
            {
            getImages()
            }
        </div>
        <div className="itemTitle">{itemTitle} ${price}</div>
        <div className="itemDesc">{itemDesc}</div>
    </div>
    </>
    )
}
